double model_symulation(const Point p){
switch( MODEL )
	{
	case STATIC:
		return static_model_symulation(p);
    
	case DYNAMIC:
		return dynamic_model_symulation(p);
			
	case SIMPLE:
		return p.getCoord(0)*p.getCoord(0)+(p.getCoord(1)-1)*(p.getCoord(1)-1);
	};
};
double model_veryfication(const Point p,const int data_ind, const std::string filename){
switch( MODEL )
	{
	case STATIC:
		return static_model_veryfication( p, data_ind, filename);
    
	case DYNAMIC:
		return dynamic_model_veryfication( p, data_ind, filename);
	};
};


